// client/src/pages/DrinkDiagram.js
import React, { useState, useEffect } from 'react';
import { useSearchParams, useNavigate } from 'react-router-dom';
import './DrinkDiagram.css';
import Navbar from '../components/Navbar';
import UserInfoModal from '../components/UserInfoModal';

function RingDiagram({ percentage }) {
  const radius = 60;
  const circumference = 2 * Math.PI * radius;
  const offset = circumference - (percentage / 100) * circumference;
  return (
    <svg width="150" height="150" className="ring-diagram">
      <circle
        className="ring-background"
        stroke="#eee"
        strokeWidth="12"
        fill="transparent"
        r={radius}
        cx="75"
        cy="75"
      />
      <circle
        className="ring-progress"
        stroke="#3f51b5"
        strokeWidth="12"
        fill="transparent"
        r={radius}
        cx="75"
        cy="75"
        strokeDasharray={circumference}
        strokeDashoffset={offset}
      />
      <text x="75" y="80" textAnchor="middle" fontSize="20" fill="#333">
        {percentage}%
      </text>
    </svg>
  );
}

export default function DrinkDiagram() {
  const [searchParams] = useSearchParams();
  const drinksParam = searchParams.get('drinks');
  let selectedDrinks = [];
  try {
    selectedDrinks = drinksParam ? JSON.parse(decodeURIComponent(drinksParam)) : [];
  } catch (e) {
    selectedDrinks = [];
  }
  const navigate = useNavigate();
  const [userInfoModalOpen, setUserInfoModalOpen] = useState(false);
  const [allowedPercentages, setAllowedPercentages] = useState({});
  
  // Retrieve user from localStorage
  const storedUser = localStorage.getItem('bacshotsUser');
  let user = storedUser ? JSON.parse(storedUser) : null;
  
  useEffect(() => {
    if (!user || !user.weight || !user.sex) {
      setUserInfoModalOpen(true);
    } else {
      calculateAllowed();
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [user, selectedDrinks]);
  
  const calculateAllowed = () => {
    // For each selected drink, calculate a dummy allowed percentage.
    const weightFactor = user.weight / 150; // baseline 150 lbs
    const sexFactor = user.sex === 'male' ? 1 : 0.8;
    const newAllowed = {};
    selectedDrinks.forEach(drinkName => {
      let drinkAbv = 5; // default beer
      if (drinkName.toLowerCase().includes("whiskey") || drinkName.toLowerCase().includes("vodka") || drinkName.toLowerCase().includes("tequila")) {
        drinkAbv = 40;
      } else if (drinkName.toLowerCase().includes("cider") || drinkName.toLowerCase().includes("cocktail")) {
        drinkAbv = 12;
      }
      const allowed = Math.min(100, Math.round((weightFactor * sexFactor * 50) / (drinkAbv)));
      newAllowed[drinkName] = allowed;
    });
    setAllowedPercentages(newAllowed);
  };

  const handleUserInfoUpdate = (newUserData) => {
    user = { ...user, ...newUserData };
    localStorage.setItem('bacshotsUser', JSON.stringify(user));
    setUserInfoModalOpen(false);
    calculateAllowed();
  };

  return (
    <div className="drink-diagram-container">
      <Navbar onSignOut={() => {
        localStorage.removeItem('bacshotsUser');
        window.location.href = '/signin';
      }} />
      <div className="drink-diagram-content">
        <h1>Tonight, you're drinking:</h1>
        {selectedDrinks.length === 0 ? (
          <p>No drink selected.</p>
        ) : (
          selectedDrinks.map((drink, idx) => (
            <div key={idx} className="drink-entry">
              <h2 className="drink-name">{drink}</h2>
              <RingDiagram percentage={allowedPercentages[drink] || 0} />
            </div>
          ))
        )}
        <button className="back-btn" onClick={() => navigate('/im-drinking')}>
          Back
        </button>
      </div>
      {userInfoModalOpen && (
        <UserInfoModal onClose={handleUserInfoUpdate} />
      )}
    </div>
  );
}
